// src/components/AppContent.js
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import WelcomeContent from './WelcomeContent';
import AdminContent from './admin/AdminContent';
import EditorContent from './admin/EditorContent'; // Placeholder for Editor component
import ViewerContent from './admin/ViewerContent'; // Placeholder for Viewer component

export default class AppContent extends React.Component {
  render() {
    return (
      <Routes>
        <Route path="/" element={<WelcomeContent />} />
        <Route path="/admin" element={<AdminContent />} />
        <Route path="/editor" element={<EditorContent />} />
        <Route path="/viewer" element={<ViewerContent />} />
        {/* Redirect to welcome for any unknown paths */}
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    );
  }
}
